import React, {Component} from "react";
import {Box} from "../dummy/Box";

export class About extends Component {
  constructor() {
    super();
    this.state = {
      people: ["Justin", "Robert", "Tom Brady"],
    };
  }

  _handleClick = (e) => {
    console.log(`Event: ${e}`);
  };

  render() {
    return (
      <div>
        <h1>About</h1>
        {this.state.people.map((person) => (
          <Box text={person} onClick={this._handleClick} />
        ))}
      </div>
    );
  }
}
